window.bookSummaryJSON = "<p>Life as Aileen knew it ended when she woke up in a morgue sporting a new set of fangs after a wild night out. Now, as a courier for the supernatural world, she balances figuring out this whole vampire thing with making enough to support her ice cream habit.</p> <p>When a job goes disastrously awry and ends with a body on the ground, Aileen finds herself in over her head as she draws the attention of a powerful creature intent on her death.</p> <p>Aileen will need to separate her allies from her enemies before it's too late. To survive, she'll work with a being she swore to avoid at all costs - a powerful vampire who may hold the key to her survival. Or the flame from which her world burns.</p>"; 
